import React from 'react';
import { View, Text } from 'react-native';

// Components
import CustomText from '../CustomText';

function Cart() {
	return (
		<View style={{ flex: 1, paddingVertical: 30, backgroundColor: 'red' }}>
			<CustomText customStyle={{ textAlign: 'center' }}>سبد خرید</CustomText>
		</View>
	);
}

export default Cart;
